n credentials for APM\r\n    Then user should login successfully with valid login\r\n    When admin user add an valid interface user\r\n    Then user validation toast message should displayed\r\n    Then user click on logout button and should successfully logout from the application\r\n\r\n  @APMTEST1\r\n  Scenario Outline: Verify the admin user privilage to change active/inactive an user\r\n    Given user navigates to the APM application\r\n    When user enter valid login credentials for APM\r\n    Then user should login successfully with valid login\r\n    When admin user edit and change to active or inactive an user\r\n    Then user validation toast message should displayed\r\n    Then user click on logout button and should successfully logout from the application\r\n\r\n  @APMTEST\r\n  Scenario Outline: Verify the inactive user able to login to the application or not\r\n    Given user navigates to the APM application\r\n    When user enter valid login credentials for APM\r\n    Then user should login successfully with valid login\r\n    When admin user edit and change the active user to inactive user\r\n    Then user validation toast message should displayed\r\n    Then user click on logout button and should successfully logout from the application\r\n    Then inactive user login to the application","uri":"src\\test\\features\\User.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Dashboard User module functionalities for APM application","description":"","children":[{"scenario":{"id":"a8ff4709-15d7-4ece-afff-3abd73153fff","tags":[{"location":{"line":3,"column":3},"name":"@APMTEST","id":"0b672985-4044-49e7-b40c-61ee6cfd7d08"}],"location":{"line":4,"column":3},"keyword":"Scenario Outline","name":"Verify the admin user privilage for user roles functionlity is working as expected","description":"","steps":[{"id":"0b49091d-5339-46f4-a35c-5e72f87
